import React from 'react';
import { Switch, Route , withRouter } from 'react-router-dom';
import CollectionPage from '../collection-page/collection-page.component';
import ProductDetailPage from '../product-detail-page/product-detail-page.component';
import SideBarHome from '../../components/sidebar-home/sidebar-home.component';

const CollectionOverView = ({match}) => (
  <>
    <SideBarHome />
    <Switch>
      <Route exact path={`${match.url}`} component={CollectionPage} />
      <Route exact path={`${match.url}/1`} component={ProductDetailPage} />
    </Switch>
  </>
);
export default withRouter(CollectionOverView);
